import React from 'react';
import './App.css';
import Products from './Components/Products/index';
import Home from './Components/Home/index';
import Contact from './Components/Contact/index';

class App extends React.Component 
{
  render() 
  {
    return (
      <div>
        <Home />
        <Contact />
        <Products />
      </div>
    );
  }
}

export default App;
